const Compra = ({ productos }) => {
    const navigate = useNavigate(); // Hook para navegaci贸n
  
    // Redirige a la vista de detalle con la informaci贸n del producto
    const verDetalleProducto = (producto) => {
      navigate(`/producto/${producto.id}`, { state: { producto } });
    };
  
    return (
      <div className="container my-5">
        <h2 className="text-center mb-4">Productos</h2>
        <div className="row">
          {productos.map((prod) => (
            <ProductoCard 
              key={prod.id} 
              producto={prod} 
              verDetalleProducto={verDetalleProducto} 
            />
          ))}
        </div>
      </div>
    );
  };
  
  export default Compra;
